window.bookSummaryJSON = "<p>From the best-selling author of <i>Money</i>.&nbsp;</p> <p>Contains an hour and a half of additional content exclusive to the eBook and audiobook editions.&nbsp;</p> <p>What are you waiting for? If you have a burning ambition, brilliant business idea or creative passion, now is the time to get going. Don't wait around for everything to fall magically into place - get started, get going and get perfect later. It's the fastest route to success.</p> <p>Hardly anyone gets it right the first time, but many of us are crippled by indecision and fear of failure. The desire to get it right can inhibit us from getting started. In this audiobook Rob Moore, the best-selling author of <i>Money</i>, shows that the quickest way to perfect is starting right now and improving as you go. This audiobook will show you how to launch your business or idea, begin the next phase of your career and overcome self-doubt - right away. Get perfect later; get started NOW.</p>"; 
